scene.onOverlapTile(SpriteKind.Player, myTiles.tile6, function (sprite, location) {
    info.setScore(0)
    game.over(false, effects.melt)
})
sprites.onOverlap(SpriteKind.Enemy, SpriteKind.Player, function (sprite, otherSprite) {
    info.setScore(0)
    game.over(false, effects.melt)
})
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Enemy, function (sprite, otherSprite) {
    if (Level == 1) {
        if (Enemy_Life >= 1) {
            Enemy_2.destroy()
        } else {
            Enemy_2.setPosition(450, 0)
        }
    } else {
        if (Enemy_Life >= 3) {
            Enemy_2.destroy()
        } else if (Enemy_Life == 2) {
            Enemy_2.setPosition(200, 75)
        } else if (Enemy_Life == 1) {
            Enemy_2.setPosition(200, 75)
        } else {
            Enemy_2.setPosition(150, 75)
        }
    }
    Enemy_Life += 1
})
controller.A.onEvent(ControllerButtonEvent.Pressed, function () {
    if (Player_1.vy == 0) {
        Player_1.vy = -125
    }
})
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.KillerMushroom, function (sprite, otherSprite) {
    otherSprite.destroy(effects.fire, 500)
})
scene.onOverlapTile(SpriteKind.Enemy, myTiles.tile6, function (sprite, location) {
    if (Enemy_Life >= 4) {
        Enemy_2.destroy()
    } else {
        Enemy_2.setPosition(450, 0)
    }
})
sprites.onOverlap(SpriteKind.KillerMushroom, SpriteKind.Player, function (sprite, otherSprite) {
    info.setScore(0)
    game.over(false, effects.melt)
})
scene.onOverlapTile(SpriteKind.Player, myTiles.tile11, function (sprite, location) {
    Level += 1
    Enemy_Life = 0
    Start_Level()
})
scene.onOverlapTile(SpriteKind.Player, myTiles.tile10, function (sprite, location) {
    Level += 1
    Enemy_Life = 0
    Start_Level()
})
